const ejs = require('ejs');
const imageDataURI = require('image-data-uri');
import SiteConfig from '../../../shared/config';

const { imageRootPath, origin } = SiteConfig;

const extn = [ 'jpeg', 'jpg', 'png' , 'gif']

function isValidextn(extenstion) {

	if(!extenstion) {
		return false
	}
	return extn.includes(extenstion.toLowerCase())
}

function checkImagePath(logoPath) {

	if (logoPath.indexOf('http://') > -1 || logoPath.indexOf('https://') > -1) {
		return logoPath;
	}

	return `${imageRootPath}/${logoPath}`;
}

export async function footer (data) {
	data.origin = origin;
	try {
		//data.realtor.name = data.realtor.licensenumber ? `${data.realtor.name} (${data.realtor.licensenumber})` : data.realtor.name;
		if(data.realtor.photo && isValidextn(data.realtor.photo.split('.').pop())) {
			const realtorPhotoDataUri = await imageDataURI.encodeFromURL(`${imageRootPath}/${data.realtor.photo}`);
			const realtorPhotoExtn = data.realtor.photo.split('.').pop();
			data.realtor.photoDataUri = realtorPhotoDataUri.replace('data:application/octet-stream',`data:image/${realtorPhotoExtn}`);
		}

		if(data.brokerageFirm && data.brokerageFirm.logo && isValidextn(data.brokerageFirm.logo.split('.').pop())) {
			const brokerPhotoDataUri = await imageDataURI.encodeFromURL(checkImagePath(data.brokerageFirm.logo));
			const brokerPhotoExtn = data.brokerageFirm.logo.split('.').pop();
			data.brokerageFirm.photoDataUri = brokerPhotoDataUri.replace('data:application/octet-stream',`data:image/${brokerPhotoExtn}`);
		}
	} catch (e) {
		console.log(e)
	}

	const template =  `
	<!DOCTYPE html>
<html lang="en-US">
<head>
    <meta charset="utf-8">
    <title>PDF Test</title>
     <style>
                	#header, #footer, body { padding: 0 !important; margin: 0 !important; -webkit-print-color-adjust: exact;}
                	
                	#footer-wrapper {
                		position: relative; 
                		font-family: "Open Sans", "Helvetica Neue", Helvetica, Arial, sans-serif; 
                		width: 100%; 
                		height : 57px;
                		display:flex;
                		justify-content : space-between; 
                		padding: 5px;
                		border-top : 1px solid #30415d;
                	}
                	
                	#footer-left, #footer-right {
                		display:flex;
                		justify-content : space-between;
                	}
                	
                	#footer-left #realtor-pic {
                	 	padding-right : 10px;
                	 }
                	 
                	.realtor-info div {
                		padding-bottom : 1px;
                	}
                	
                	#realtor-pic {
                		width: 55px;
                		height : 55px;
                	}
                	#realtor-pic img {
                		max-width : 100%;
                		max-height : 100%;
                	}
                	
                	.realtor-info {
                		font-size : 12px;
                	}
                	
                	.realtor-name {
                		font-size : 14px;
                	}
                	
                	.realtor-name a {
                		color : #000;
                	}
                	
                	#footer-right .realtor-info {
                		text-align : right;
                	}
                	
                	#footer-right #realtor-pic {
                		padding-left : 10px;
                	}
                	
                	
                </style>
</head>
<body>
<footer id="footer-wrapper">
    <%if (data.realtor) {%>  
		<div id="footer-left">
			<%if (data.realtor.photo) {%>
				<div id="realtor-pic">
					<img src="<%= data.realtor.photoDataUri %>" />
				</div>
			<%}%>
			<div class="realtor-info">
				<div class="realtor-name">
					<%if (data.realtor.siteurl) {%> 
						<a href="<%= data.origin%><%= data.realtor.siteurl %>" target="_blank"><%= data.realtor.name%></a>
					<%} else {%>
						<%= data.realtor.name%>
					<%}%>
					<%if (data.realtor.licensenumber) {%> 
					<span>(#<%= data.realtor.licensenumber%>)</span>
					<%}%>
				</div>
				<div class="realtor-phone"> 
					<%if (data.realtor.phone) {%>
						<%= data.realtor.phone.replace(/./g,(v,i)=>(i === 2 || i === 5) ? v + '-' : v)%>
					<%}%>
				</div>
				<div class="realtor-email"><%= data.realtor.email%></div>
			</div>
				
		</div>
    <%}%>
    <%if (data.brokerageFirm) {%>  
		<div id="footer-right">
			<div class="realtor-info">
				<div class="realtor-name">
					<%= data.brokerageFirm.name%>
					<%if (data.brokerageFirm.siteurl) {%> 
						<a href="<%= data.brokerageFirm.siteurl %>"></a>
					<%}%>
				</div>
				<div class="realtor-phone"> 
					<%if (data.brokerageFirm.phone) {%>
						<%= data.brokerageFirm.phone.replace(/./g,(v,i)=>(i === 2 || i === 5) ? v + '-' : v)%>
					<%}%>
				</div>
				<div class="realtor-email"><%= data.brokerageFirm.email%></div>
			</div>
			<%if (data.brokerageFirm.logo) {%>
				<div id="realtor-pic">
					<img src="<%= data.brokerageFirm.photoDataUri %>" />
				</div>
			<%}%>	
		</div>
    <%}%>
</footer>
</body>
</html>`
	return ejs.render(template, { data : data});
}

